import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";
import {withAutorization} from './Autorization.js';




class Navigation extends React.Component {


tologoutSubmit=(event)=>{
  event.preventDefault();

  this.props.tologout();
  this.props.history.push("/");

}


  render() {
    return (



     <ul>

     <li>
       <h1>{this.props.isLogged? <button onClick={this.tologoutSubmit}>Je me déconnecte</button>: ""}</h1>
     </li>
     <li>
      <h1>{this.props.isLogged?"Connecté": "déconnecté"}</h1>
     </li>

        <li> <Link to="/">Home</Link>  </li>
        <li> <Link to="/signin">SignIn</Link>  </li>
     </ul>



     );
  }

}

export default withAutorization(Navigation);
